import React from 'react';
import Cardimg from '../components/images/7.jpg'

export default function Card() {
    return (
        <section className='card-container'>
            < img src={Cardimg} 
            className='card-img1'
            />
            <div>
                <img className='card-img2' />
                <p className='card-para'>Life lessons with Jayden</p>
            </div>
            <h3 className='card-text'>From $136<span> / person</span></h3>
        </section>
    )
}
